('821f5ce9-359f-41bc-893c-b9bdc91e46d5', 'О нас', '2023-04-12 17:00:00', 'about', '', 'Общество с ограниченной ответственностью «ДЕ-ПА» (УНП 291477952) является эксклюзивным дистрибьютером турецких производителей электротехнической, светотехнической и кабельно-проводниковой продукции, таких как «DE-PA ELECTRIC», «MONO ELECTRIC», «HISAR ELECTRIC», «RECBER KABLO», «EBION KABLO» которые уже более 35 лет являются известнейшими производителями и поставщиками электроустановочных изделий, светильников, кабельной продукции, наконечников не только в Турции, но и в России, Казахстане, Украине, Европе, Ираке, Иране, Алжире и др. странах мира.\\n\\nПредлагаем Вам со склада в Беларуси полный ассортимент кабельно-проводниковой продукции турецкого завода-изготовителя «HISAR ELECTRIC», «RECBER KABLO», «EBION KABLO»: алюминиевые, медные, телефонные, телевизионные, силовые провода и кабели, разъемы плоские наконечники, наконечники кольцевые, терминалы проводов, а также следующую продукцию по низким ценам:\\n\\n**Электроустановочные изделия**: удлинители 1, 2, 3, 4, 5, 6 местные с шторками и без, в том числе с сетевым выключателем, колодки удлинителя 2, 3, 4, 5, 6 местные, в том числе с выключателем, розетки, выключатели, электропатроны Е27, выключатели для бра, вилки разборные 6 А, 16 А, переходники, разветвители, штепсельные гнёзда.\\n\\n**Светильники светодиодные**: светильники ЖКХ, энергосберегающие светильники для общественных и бытовых помещений различных цветов (белые, золотые, темно-серые, серебристые, цвета металлик, вишни, бук, орех), влагозащищённые светильники IP 65, в том числе светильники со встроенными датчиками движения.\\n\\n**Коробки под автоматы**: коробки под 1, 2, 4, 6, 9, 12, 18, 36 автоматов внутренние и наружные (белые с темным стеклом, а также цвета дуб, орех).\\n\\n**Кабельные каналы**: кабельные каналы 12х12 мм, 40х16 мм, 80х60 мм, 15х10 мм, 40х25 мм, 100х40 мм, 16х16 мм, 40х40 мм, 100х60 мм, 20х13 мм, 40х60 мм, 120х60 мм, 25х16 мм, 60х60 мм, 25х25 мм,80х40 мм, 30×20 мм.\\n\\n**Светодиодные панели**: светодиодные панели 16,8 Вт, 33,6 Вт, 48 вт.\\n\\n**Уличные консольные светильники**: LED 45 Вт, 60 Вт, 90 Вт, 120 Вт, 150 Вт, 185 Вт, 200 Вт.\\n\\n**Прожектор**: 18 Вт, 25 Вт, 35 Вт, 50 Вт, 60 Вт, 92 Вт.', 20000, 'ДЕ-ПА', 'Общество с ограниченной ответственностью «ДЕ-ПА» (УНП 291477952) является эксклюзивным дистрибьютером турецких производителей электротехнической, светотехнической и кабельно-проводниковой продукции', 1),
('a4dfcef1-0861-4f46-bce9-454e6bd74f8b', 'Главная', '2023-04-12 17:00:00', 'index', '', '# ООО \"ДЕ-ПА\"\n\n![](https://raw.githubusercontent.com/ooodepa/assets/main/articles/home/SHOWROOM.jpg)\n\nОбщество с ограниченной ответственностью «ДЕ-ПА» является офицальным представителем «DE-PA ELECTRIC», являющееся одним из ведущих производителей электротоваров в Турции, и реализует электротехническую и светотехническую продукцию:\\n\\n- выключатели, розетки, разветвители, вилки, удлинители, электропатроны, боксы под автоматы, коробки монтажные и др.;\\n- светильники: офисные, промышленные, уличные, прожекторы и др.;\\n- кабель-каналы;\\n- хомуты пластиковые;\\n- шкафы распределительные, щиты, ящики, корпуса металлические и пластиковые и др.\\n\\nПредприятие является импортером Турецкого производителя DE-PA ELECTRIC (первым официальном поставщиком) и поставляет продукцию в Республику Беларусь. Для большей заинтересованности Вами в приобретении продукции разработана гибкая система формирования цен.\\n\\nВзаимовыгодное сотрудничество с нами позволит Вам расширить линейку товаров и спектр оказываемых услуг. Можем отгружать под Вашим брендом, полуфабрикатом, можем готовыми к продаже!!! Мы заинтересованы в открытии новых представительств и точек продаж на всей территории Беларуси.', 10000, 'de-pa electric', 'Общество с ограниченной ответственностью «ДЕ-ПА» является офицальным представителем «DE-PA ELECTRIC», являющееся одним из ведущих производителей электротоваров в Турции', 1);
